import React from 'react';

export default function VgCard({name, image, genre, id, rating}){
    return (
        <div key={id}>
            <img src={image} alt="Videogame_image" width="200" height="250"/>
            <h3>{name}</h3>
            <div>{genre}</div>
            <div>{rating}</div>
        </div>
    )
}
